import React from 'react'
import MenuItem from '../components/Menu/MenuItem'

const Menu = () => {

    const Menu = {
        name: "Amila nuwan",
        price: 600
    }

    return (
        <React.Fragment>
            <h1>Menu</h1>

            <MenuItem name={M} price="500"/>
            
        </React.Fragment>
    )
}

export default Menu
